// src/components/FeedbackPage.jsx
import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';

const FeedbackPage = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const { role, level, feedbacks } = location.state || {};

  if (!feedbacks) {
    return (
      <div style={{ padding: '20px' }}>
        <h2>Tidak ada feedback yang ditemukan.</h2>
        <button onClick={() => navigate('/')}>Kembali ke Simulasi</button>
      </div>
    );
  }

  return (
    <div style={{ padding: '20px', maxWidth: '800px', margin: 'auto' }}>
      <h1>Feedback Simulasi Wawancara</h1>
      <h2>{role} ({level})</h2>

      {feedbacks.map((f, idx) => (
        <div key={idx} style={{
          border: '1px solid #ddd',
          borderRadius: '8px',
          padding: '15px',
          marginBottom: '15px',
          backgroundColor: '#f9f9f9'
        }}>
          <h3>{f.question}</h3>
          <p><strong>Feedback:</strong> {f.feedback_text}</p>
        </div>
      ))}

      <button onClick={() => navigate('/')} style={{
        padding: '10px 20px',
        backgroundColor: '#007bff',
        color: 'white',
        border: 'none',
        borderRadius: '5px',
        cursor: 'pointer'
      }}>
        Kembali ke Simulasi
      </button>
    </div>
  );
};

export default FeedbackPage;
